import React from 'react';
import { Route, Navigate } from 'react-router-dom';
import { isAuthenticated } from '../services/auth';

const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route
        {...rest}
        render={props =>
            isAuthenticated() ? (
                children
            ) : (
                <Navigate to="/login" />
            )
        }
    />
);

export default PrivateRoute;
